import React, { useState } from "react";
import { Outlet } from "react-router-dom";
import Log from "./Log";
import axios from "axios";
async function Pr() {
  const ud = sessionStorage.getItem("ud");
  const [per, setper] = useState(false);
  await axios
    .post("/pr", {
      ud: ud,
    })
    .then((res) => {
      if (res.data.per === "ac") {
        setper(true);
      } else {
        setper(false);
      }
    });
  return per ? <Outlet /> : <Log />;
}
export default Pr;
